import React, {useEffect, useState} from 'react';

function App() {
  const [data, setData] = useState([{}]);

  useEffect(() => {
    fetch('/api').then(
      response => response.json()
    ).then(
      data => {
        setData(data)
      }
    );
  }, []);

  return (
    <ul>
      {data.users.map(user => {
        return <li>{user}</li>
      })}
    </ul>
  );
}

export default App;
